import React from "react";
import CardList from "./displays/CardList";
import EditWindow from "./displays/EditWindow";

const App = () => {
  return (
    <div className="ui container" style={{ paddingTop: "25px" }}>
      <h1 className="ui center aligned icon header">DBL Inventory System</h1>
      <EditWindow
        button={<button className="ui blue button">Add item</button>}
        data={[]}
        action="Add new item"
      />
      <br /> <br />
      <CardList />
    </div>
  );
};

export default App;
